import { players } from "../nba_player_data_20-21-";
import "./PlayerCard.css";
function PlayerCard() {
  console.log("players", players);

  //For now, let's just use one player as example.

  const player = players[0];
  console.log("here is our example player", player);
  return (
    <div className="whole-card">
        <h1 className="player-name">{player.Player}</h1>
        <div className="card-box">
            <div className="data-labels">
                <p>FGM/A</p>
                <p>FG%</p>
                <p>FTM/A</p>
                <p>FT%</p>
                <p>3PTM</p>
                <p>PTS</p>
                <p>REBS</p>
            </div>
            <div className="time-label">Last week</div>
            <div className="time-label">Last 2 weeks</div>
            <div className="time-label">Last month</div>
            <div className="time-label">2019 Season</div>
        </div>
    </div>
  );
}

export default PlayerCard;
